<!DOCTYPE html>
<html>

	<head>
		<style>
			html,body{margin:0px; padding:0px; width:100%; height:100%;}
			body{background-color: black;}

			canvas{
				margin: auto;
				border:1px solid white;
			}

			#uniforms-UI {
				border: 1px solid white;
				background-color: rgb(38, 38, 38);
				display: none;
				position: absolute;
				top: 0;
				left: 0;
				min-width: 250px;
				min-height: 200px;
			}
			#uniforms-title {
				display: inline-block;
				margin-left: 5px;
				font-size: 18px;
				font-family: 'Trebuchet MS', 'Lucida Sans Unicode', 'Lucida Grande', 'Lucida Sans', Arial, sans-serif;
				font-weight: bold;
				text-decoration: underline;
				color: white;
			}
			#uniforms-form {
				margin-left: 10px;
			}

			.input-ctn {
				justify-content: left;
				display: flex;
				margin-right: 10px;
				margin-bottom: 5px;
				min-width: 250px;
			}
			.par-group-header {
				font-size: 14px;
				font-family: 'Trebuchet MS', 'Lucida Sans Unicode', 'Lucida Grande', 'Lucida Sans', Arial, sans-serif;
				color: white;
				text-decoration: underline;
				margin-bottom: 6px;
			}
			.par-label {
				
				width: 60px;
				align-self: center;
				font-size: 12px;
				font-family: 'Gill Sans', 'Gill Sans MT', 'Calibri', sans-serif;
				color: rgb(195, 195, 195);
			}
			.input-val {
				background-color: aliceblue;
				margin-right: 6px;
			}
			.xyz {
				width: 50px;
			}
			.f1 {
				width: 180px;
			}

		</style>

		<div id="uniforms-UI">
			<h1 id="uniforms-title">UNIFORMS</h1>
			<br>
			<div id="uniforms-form">
				<label id="camera-header" class="par-group-header">Camera</label><br>
				<div class="input-ctn">
					<label class="par-label" for="cam-pos">Position:</label>

					<input type="number" placeholder="2.0" class="input-val xyz" id="cam-pos-z" name="cam-pos">

				</div>
				<div class="input-ctn">
					<label class="par-label" for="cam-fov">FOV:</label>

					<br>
				</div>
				<br>

				<label id="light-header" class="par-group-header">Light</label><br>
				<div class="input-ctn">
					<label class="par-label" for="light-pos">Position:</label>
					<input type="number" placeholder="0" class="input-val xyz" id="light-pos-x" name="light-pos">
					<input type="number" placeholder="0" class="input-val xyz" id="light-pos-y" name="light-pos">
					<input type="number" placeholder="2.0" class="input-val xyz" id="light-pos-z" name="light-pos">

					<label class="par-label" for="light-color">Color:</label>

					<input type="number" placeholder="1.0" class="input-val xyz" id="light-color-g" name="light-color">

		<div id="js-files">
			<script src="homepage.core.js"></script>

		<script>

			var gl, gRLoop,
				gIcos, gIcosUniforms, gIcosMat,
				gName, gNameUniforms, gNameMat,
				gMainShader,
				gCamera, gLight, gMouseCtrl,
			    oUI;

			var uiElem = document.getElementById("uniforms-UI");
			window.addEventListener("keypress", (e) => {
				if (e.key == "p") {uiElem.style.display == "none" ? uiElem.style.display = "block" : uiElem.style.display = "none";}
			});

			window.addEventListener("load",function() {

				//....................................
				//Setup GL context
				//....................................
				//gl = GLInstance("glcanvas").fFitScreen(1.0,1.0).fClear();
                Homepage.Init("glcanvas").fFitScreen(1.0, 1.0).fClear();
				
                if (Homepage.gl == null) console.error("no gl created by Init()");
				//....................................
				//Setup Uniforms, Shaders and Materials
				//....................................
				gIcosUniforms = function() { return [
					["uMVMatrix", "mat4", gIcos.transform.getViewMatrix()],
					["uPMatrix", "mat4", gCamera.projectionMatrix],
					["uCameraMatrix", "mat4", gCamera.viewMatrix],
					["uNormMatrix", "mat3", gIcos.transform.getNormalMatrix()],
					["uCamPos", "3fv", gCamera.transform.position.getArray()],
					["uLightPos", "3fv", gLight.transform.position.getArray()],
					["uBaseColor", "3fv", gIcos.color.getArray()],
					["uLightIntensity", "1f", gLight.intensity]
				]};
				gNameUniforms = function() { return [
					["uMVMatrix", "mat4", gName.transform.getViewMatrix()],
					["uPMatrix", "mat4", gCamera.projectionMatrix],
					["uCameraMatrix", "mat4", gCamera.viewMatrix],
					["uNormMatrix", "mat3", gName.transform.getNormalMatrix()],
					["uCamPos", "3fv", gCamera.transform.position.getArray()],
					["uLightPos", "3fv", gLight.transform.position.getArray()],
					["uBaseColor", "3fv", gName.color.getArray()],
					["uLightIntensity", "1f", gLight.intensity]
				]};
                Homepage.Res.fUniformBlocks["fIcosUniforms"] = gIcosUniforms;
                Homepage.Res.fUniformBlocks["fNameUniforms"] = gNameUniforms;


				//gMainShader = Shader.create(gl, "vertex-shader", "fragment-shader", false);
                gMainShader = new Homepage.Shader("MainShader", "vertex-shader", "fragment-shader", false);

				gIcosMat = Homepage.Material.create("IcosMaterial", gMainShader, Homepage.gl.TRIANGLES);
				gNameMat = Homepage.Material.create("NameMaterial", gMainShader, Homepage.gl.TRIANGLES);
						
				
				//....................................
				//Setup Models, Camera, Light
				//....................................
				gCamera = new Homepage.Camera(80, 0.1, 100);
				gCamera.setPosition(0, 0, 0);
				
				gLight = new Homepage.Light();
				gLight.setPosition(1,0,4).setIntensity(0.5).setColor(1,1,1);

				gIcos = Homepage.Model.create("IcosModel", Homepage.ObjLoader.domToMesh("objIcos", "icosObj-file", true, true), gIcosMat);
				gIcos.setPosition(0,0,0).setScale(1,1,1).setColor(1,1,1)
					 .applyMouseCtrl()
					 .updateViewMatrix()//.updateUniforms(gIcosUniforms())
					 .setUniformsGetter(gIcosUniforms).applyUniforms();
				//gMouseCtrl = new MouseEffects(gl, gIcos);
				
				gName = Homepage.Model.create("NameModel", Homepage.ObjLoader.domToMesh("objName", "nameObj-file", true, true), gNameMat);
				gName.setPosition(0,0,0).setScale(.6, .6, .6).setColor(0.8, 0.24, 0.0)
					 .updateViewMatrix()//.updateUniforms(gNameUniforms());
					 .setUniformsGetter(gNameUniforms).applyUniforms();


				//....................................
				//Setup UI Functionality
				//....................................
				oUI = new Homepage.UI(gCamera, gLight, gIcos, gName, gMouseCtrl);


				//....................................
				//Start Rendering
				//....................................
				gRLoop = new Homepage.RenderLoop(onRender,30).start();

			});

			function onRender(dt){
				Homepage.gl.fClear();
				Homepage.gl.fFitScreen(1,1);
				Homepage.Render([gIcos, gName], gCamera, gLight);
			}

		</script>
	</head>

		<script id="vertex-shader" type="x-shader/x-vertex">#version 300 es
			in vec3 a_position;
			in vec3 a_norm;
			in vec2 a_uv;

			uniform mat4 uPMatrix;
			uniform mat4 uMVMatrix;
			uniform mat4 uCameraMatrix;
			uniform mat3 uNormMatrix;
			uniform vec3 uCamPos;

			out vec3 vPos;
			out vec3 vNorm;
			out vec3 vCamPos;
			out highp vec2 vUV;
			
			void main(void){
				//Setup some fragment vars
				vec4 pos = uMVMatrix * vec4(a_position.xyz, 1.0);	//Need Position in World Space
				vPos = pos.xyz;
				vNorm =  uNormMatrix * a_norm;						//Need Norm Scaled/Rotated correctly //
				//vNorm = normalize(pos).xyz;
				vUV = a_uv;
				vCamPos = (inverse(uCameraMatrix) * vec4(uCamPos,1.0)).xyz; //need to Move CameraPos into World Space for Specular Calculation.
				
				//Set Final Position
				gl_Position = uPMatrix * uCameraMatrix * pos; 
			}
		</script>

		<script id="fragment-shader" type="x-shader/x-fragment">#version 300 es
			precision mediump float;
			
			uniform sampler2D uTexture;	//Holds the texture we loaded to the GPU
			uniform vec3 uLightPos;
			uniform vec3 uBaseColor;
			uniform float uLightIntensity;

			in vec3 vPos;
			in vec3 vNorm;
			in highp vec2 vUV;
			in vec3 vCamPos;

			out vec4 outColor;

			void main(void){
				//Setup Basic Colors 
				//vec4 cBase = texture(uTexture, vUV);
				vec4 cBase = vec4(uBaseColor, 1.0);
				
				vec3 cLight = vec3(uLightIntensity);

				//...........................
				//setup ambient light
				float ambientStrength = 0.15;
				vec3 cAmbient = ambientStrength * cLight;

				//...........................
				//setup diffuse
				vec3 lightDir = normalize(uLightPos - vPos); //Distance between Pixel and Light Source, Normalize to make it a direction vector
				float diffAngle = max(dot(vNorm,lightDir),0.0);
				float diffuseStrength = 0.2;
				vec3 cDiffuse = diffAngle * cLight * diffuseStrength;	

				//...........................
				//setup specular 
				//NOTE : Might be easier to switch vertexPos, light and camera to local space. Can remove inverse of camera matrix in the process. For prototyping keeping things in WorldSpace.
				float specularStrength = 0.8f;	
				float specularShininess = 1.0f; 
				vec3 camDir = normalize(vCamPos - vPos);	//Get the camera direction from the fragment position.
				vec3 reflectDir = reflect(-lightDir,vNorm);	//Using the normal as the 45 degree type of pivot, get the reflective direction from the light direction

				float spec = pow( max(dot(reflectDir,camDir),0.0) ,specularShininess);	//Now determine the angle of the reflective dir and camera, If seeing spot on (90d) then full light.
				vec3 cSpecular = specularStrength * spec * cLight;

				//...........................
				//Final
				vec3 finalColor = (cAmbient + cDiffuse + cSpecular) * cBase.rgb; //Combined Light Strength and apply it to the base color
				outColor = vec4(finalColor,1.0);
			}
		</script>
